	import Vue from 'vue'
	import { request, navigateTo } from '@/common/utils/util'
	import { UserLogin } from '@/common/config/api'
	import uniGrid from '@/components/uni-grid/uni-grid.vue'
	import uniList from '@/components/uni-list/uni-list.vue'
	import uniListItem from '@/components/uni-list-item/uni-list-item.vue'
	import uniIcon from '@/components/uni-icon/uni-icon.vue'
	export default Vue.extend({
		components: {
			uniGrid,
			uniList,
			uniListItem,
			uniIcon
		},
		data() {
			return {
				userInfo: '',
				Integrals: '',
				lists: [{
					id: '0',
          image: '/static/icon/icon_pending_address.png',
					text: '待填地址',
					status: '0',
          navigateTo: 'orderList'
        },
        {
					id: '1',
          image: '/static/icon/icon_pending_payment.png',
					text: '待付款',
					status: '1',
          navigateTo: 'orderList'
        },
        {
					id: '2',
          image: '/static/icon/icon_pending_receipt.png',
					text: '待收货',
					status: '3',
          navigateTo: 'orderList'
        },
        {
					id: '3',
          image: '/static/icon/icon_pending_order.png',
					text: '待晒单',
					status: '4',
          navigateTo: 'orderList'
        }],
				listItem: [{
					icon: '/static/icon/icon_auction.png',
					title: '我的竞拍',
					navigateTo: 'myAuction'
				},{
					icon: '/static/icon/icon_order.png',
					title: '我的晒单',
					navigateTo: 'myOrder'
				},{
					icon: '/static/icon/icon_address.png',
					title: '收货地址',
					navigateTo: 'addressShipping'
				},{
					icon: '/static/icon/icon_share.png',
					title: '分享得豪礼',
					navigateTo: 'sharePromotion'
				},{
					icon: '/static/icon/icon_feedback.png',
					title: '帮助反馈',
					navigateTo: 'helpAndFeedback'
				}]
			}
		},
		onLoad() {
			this.useInfo()
		},
		onShow() {

		},
		methods: {
			useInfo() {
				this.userInfo = uni.getStorageSync('UserInfo')
				console.log(this.userInfo)
			},
			VIPCard() {
				console.log('11')
				navigateTo('../store/store/store')
			},
			// 马上登录
			loginPath() {
				navigateTo('../ucenter/login/login')
			},
			// 去充值
			recharge() {
				navigateTo('../ucenter/recharge/recharge')
			},
			// 全部订单
			allOrderClick() {
				navigateTo('../ucenter/orderList/orderList')
			},
			// status=> 
			// 等待填写地址 = 0,
			// 等待付款 = 1,
			// 等待发货 = 2,
			// 等待收货 = 3,
			// 等待晒单 = 4,
			// 成功完成 = 5,
			// 订单取消 = 6
			orderClick(item: any) {
				console.log(item)
				let status = item.status
				var navigate = `../ucenter/${item.navigateTo}/${item.navigateTo}?status=` + status
				navigateTo(navigate)
			}
		}
	});
